import { Link } from "react-router-dom";
const AllQuotes = () => {

    return (
        <section>

        <h1>All Quotes</h1>
        <ul>
            <li>
                <Link to='/quote/q1'>Life</Link>
            </li>
            <li>
                <Link to='/quote/q2'>Love</Link>
            </li>
            <li>
                <Link to='/quote/q3'>Games</Link>
            </li>
        </ul>
        </section>
    );
};
export default AllQuotes;
